import React, { useState, useEffect } from "react";

interface FinancialEntry {
  id: number;
  type: "Receita" | "Despesa" ;
  description: string;
  amount: number;
  date: string;
}

const FinancialManagement: React.FC = () => {
  const [financialData, setFinancialData] = useState<FinancialEntry[]>([]);
  const [currentBalance, setCurrentBalance] = useState<number>(0);
  const [newEntry, setNewEntry] = useState<Partial<FinancialEntry>>({
    type: "Receita",
    description: "",
    amount: 0,
    date: "",
  });

  useEffect(() => {
    // Aqui você faria uma chamada à API para obter os dados financeiros
    // Por enquanto, usaremos dados de exemplo
    const sampleFinancialData: FinancialEntry[] = [
      {
        id: 1,
        type: "Receita",
        description: "Consulta",
        amount: 100,
        date: "2024-03-18",
      },
      {
        id: 2,
        type: "Despesa",
        description: "Medicamentos",
        amount: 50,
        date: "2024-03-17",
      },
      {
        id: 3,
        type: "Transferência",
        description: "Transferência bancária",
        amount: 30,
        date: "2024-03-16",
      },
      // Outros registros financeiros...
    ];
    setFinancialData(sampleFinancialData);
  }, []);

  useEffect(() => {
    const newBalance = financialData.reduce((balance, item) => {
      if (item.type === "Receita") {
        return balance + item.amount;
      } else {
        return balance - item.amount;
      }
    }, 0);
    setCurrentBalance(newBalance);
  }, [financialData]);

  const handleAddEntry = () => {
    if (!newEntry.description || !newEntry.amount || !newEntry.date) {
      alert("Por favor, preencha todos os campos");
      return;
    }
    const id = financialData.length + 1;
    const entry: FinancialEntry = { id, ...newEntry } as FinancialEntry;
    setFinancialData([...financialData, entry]);
    setNewEntry({ type: "Receita", description: "", amount: 0, date: "" });
  };

  return (
    <div>
      <h2>Gestão Financeira</h2>
      <h3>Saldo Atual: R$ {currentBalance.toFixed(2)}</h3>
      <div>
        <h3>Adicionar Lançamento Financeiro</h3>
        <div>
          <label>Tipo:</label>
          <select
            value={newEntry.type}
            onChange={(e) =>
              setNewEntry({
                ...newEntry,
                type: e.target.value as "Receita" | "Despesa",
              })
            }
          >
            <option value="Receita">Receita</option>
            <option value="Despesa">Despesa</option>
          </select>
        </div>
        <div>
          <label>Descrição:</label>
          <input
            type="text"
            value={newEntry.description}
            onChange={(e) =>
              setNewEntry({ ...newEntry, description: e.target.value })
            }
          />
        </div>
        <div>
          <label>Valor:</label>
          <input
            type="number"
            value={newEntry.amount}
            onChange={(e) =>
              setNewEntry({ ...newEntry, amount: parseFloat(e.target.value) })
            }
          />
        </div>
        <div>
          <label>Data:</label>
          <input
            type="date"
            value={newEntry.date}
            onChange={(e) => setNewEntry({ ...newEntry, date: e.target.value })}
          />
        </div>
        <button onClick={handleAddEntry}>Adicionar</button>
      </div>
      <table>
        <thead>
          <tr>
            <th>Tipo</th>
            <th>Descrição</th>
            <th>Valor</th>
            <th>Data</th>
          </tr>
        </thead>
        <tbody>
          {financialData.map((item) => (
            <tr key={item.id}>
              <td>{item.type}</td>
              <td>{item.description}</td>
              <td>{item.amount}</td>
              <td>{item.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
      {/* Aqui você pode adicionar ferramentas adicionais de gestão financeira, como lançamento financeiro da agenda ou prontuário, cadastro de convênios, etc. */}
    </div>
  );
};

export default FinancialManagement;
